import React from 'react';
import classes from "./About.module.css";
import PageHeader from '../PageHeader/PageHeader';
import Me from './../../Components/img/ritik.jpg';
const About = () =>{
    return(
        <>
        <div className={classes.AboutMe} id="about">
        <div data-aos="fade-up" data-aos-duration="3000">
         <PageHeader title={"About Me"}></PageHeader>
         <div className={classes.Container}>
             <div className={classes.Text}>
                 <h2>Hello: Iam Ritik</h2>
                 <p>
                 I am a IT student at UIET Panjab University. I always focussing learning new things . I have good command on C, C++, python programming language along with the Tkinter GUI.
From the frontend part i have the knowledge of HTML5 , CSS, Javascript, jQuery and React.js .
Apart from this i also have the knowledge of various data manipulation and visualization tools like numpy, pandas, matplotlib, seaborn and also ML tools like Skilearn i also made projects using Deep learning, OpenCV.
I have 6 star on Hackerrank for Problem Solving and 5 star for C++ programming language.
                 </p>
             </div>
             <div className={classes.Photo}>
             <div data-aos="fade-right">
                 <img className={classes.Me} src={Me} alt="My Image"></img>
                 </div>
             </div>
         </div>
        </div>
        </div>
        </>
    );
}

export default About;
